import React from "react";

const AboutBlock = ({ props }) => {
  return (
    <div>
      <Link to={props.link} className='about-block-link'>
        <div className='about-block'>
          <p className='about-block-text'>{props.text}</p>
        </div>
      </Link>
    </div>
  );
};

export default AboutBlock;
